import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { FontAwesome } from "@expo/vector-icons";

import RoutesScreen from "./RoutesScreen";
import MapScreen from "./MapScreen";
import PaymentsScreen from "./PaymentsScreen";
import MenuScreen from "./MenuScreen";

const Tab = createBottomTabNavigator();

const BottomNavTab = () => {
    return(
        <Tab.Navigator>
            <Tab.Screen name="Маршруты" component={RoutesScreen} />
            <Tab.Screen name="Карты" component={MapScreen} />
            <Tab.Screen name="Платежи" component={PaymentsScreen} />
            <Tab.Screen name="Меню" component={MenuScreen} />
        </Tab.Navigator>
    )
}

export default BottomNavTab;
